---
name: Cheaper Than Dirt
domain: www.cheaperthandirt.com
read_interval: 1440
timezone:
registrations:
  session_queue:
    www.cheaperthandirt.com: {}
  object_adapter:
    www.cheaperthandirt.com/product_page:
      $key: globals/product_page
      attribute:
        title:
        - find_by_xpath:
            xpath: //span[@id="ctl00_ctl00_ContentPlaceHolderTopLevel_ContentPlaceHolderItemDetailRight_ProdDesc"]
        description:
        - meta_description
        image:
        - meta_image
        sale_price_in_cents:
        - find_by_xpath:
            xpath: .//span[contains(@class, "product-price-value")]
        price_in_cents:
        - meta_price
        - find_by_xpath:
            xpath: //div[@id="ctl00_ctl00_ContentPlaceHolderTopLevel_ContentPlaceHolderItemDetailRight_ourLowPricePanel"]
            pattern: !ruby/regexp '/\$\d[\d\,\.]+/i'
        availability:
        - label_by_xpath:
            label: out_of_stock
            xpath: //div[@class="importantMessageItemPage"]
            pattern: !ruby/regexp '/this product is currently not in stock|no longer
              available/i'
        - value: in_stock
        condition:
        - label_by_xpath:
            label: New
            xpath: .//table[@class="product-properties"]/tr/td[@class="property-value"]
            pattern: !ruby/regexp '/used/i'
        - label_by_xpath:
            label: Used
            xpath: .//table[@class="product-properties"]/tr/td[@class="property-value"]
            pattern: !ruby/regexp '/new/i'
        - value: new
        product_category1:
        - label_by_xpath:
            label: Guns
            xpath: //div[@class="itemBreadCrumbs"]/a
            pattern: !ruby/regexp '/handguns|rifles|shotguns|tactical|firearms/i'
        - label_by_meta_tag:
            label: Guns
            pattern: !ruby/regexp '/Gun/'
            attribute: name
            value: mc-category
        - label_by_meta_tag:
            label: Ammunition
            pattern: !ruby/regexp '/Ammo|Ammunition/i'
            attribute: name
            value: mc-category
        - label_by_meta_tag:
            label: Optics
            pattern: !ruby/regexp '/scopes/i'
            attribute: name
            value: mc-category
        - label_by_xpath:
            label: Ammunition
            xpath: //div[@class="itemBreadCrumbs"]/a
            pattern: !ruby/regexp '/Ammo|Ammunition/i'
        - label_by_xpath:
            label: Optics
            xpath: //div[@class="itemBreadCrumbs"]/a
            pattern: !ruby/regexp '/scopes/i'
        - label_by_xpath:
            label: Accessories
            xpath: //div[@class="itemBreadCrumbs"]/a
            pattern: !ruby/regexp '/Gun Gear and Parts|Magazines|pods|Black Powder|Protection|Cases|Cleaning|Gunsmithing|Holsters|Lasers|Lights|Range|Targets|Reloading|Slings|loaders|Universal
              Gun Parts/i'
        type:
        - value: RetailListing
        location:
        - value: 2058 West University Drive, McKinney, Texas 75071
    www.cheaperthandirt.com/product_link:
      $key: globals/product_link
      xpath: //div[@class='prodis']/a
      attribute:
        product_link:
        - find_by_xpath:
            xpath: ./@href
        seller_domain:
        - value: www.cheaperthandirt.com
affiliate_link_tag:
affiliate_program:
